        Ans_19 = 1,
        I_13 = 0,
        Fun_21 = fun Fun_21_loop(Ans_19, Fib1, I_13, N_7, Tmp) ->
    case (I_13 < (N_7 - 1)) of
        true ->
            Tmp_2 = Ans_19,
            Ans_20 = (Ans_19 + Fib1),
            Fib1_2 = Tmp_2,
            I_14 = (I_13 + 1),
            Fun_21_loop(Ans_20, Fib1_2, I_14, N_7, Tmp_2);
        _ -> {Ans_19, Fib1, I_13, N_7, Tmp}
    end
end,
{Ans_20, Fib1_2, I_14, N_7, Tmp_2} = Fun_21(Ans_19, Fib1, I_13, N_7, Tmp),
        Ans_20
    catch {return, Ret} -> Ret end.

